require('dotenv').config();
const { Telegraf } = require('telegraf');

const bot = new Telegraf(process.env.BOT_TOKEN);

// THE TEST BASE64
// Tip: Keep the quotes, and paste the giant string inside them.
const myBase64 = "";

bot.start(async (ctx) => {
    ctx.reply(" Testing PDF Conversion and Delivery...");

    try {
        // 1. Convert the Base64 string into a Buffer (Binary Data)
        // Node.js is smart: it ignores the {"pdf": part if you only paste the string
        const pdfBuffer = Buffer.from(myBase64, 'base64');

        // 2. Send it to Telegram
        await ctx.replyWithDocument({ 
            source: pdfBuffer, 
            filename: `Manual_Fayda_Test.pdf` 
        }, { 
            caption: " Conversion Successful! Does this PDF open?" 
        });

        console.log(" PDF sent successfully to Telegram!");
    } catch (e) {
        console.error(" Error during conversion:", e);
        ctx.reply(" Failed to convert Base64. Check your console.");
    }
});

bot.launch().then(() => console.log(" Test Bot is running... Send /start in Telegram!"));